import React from "react"

const ImageSilder = ({ link, alt }) => {
  return (
    <div className="imagesilder">
      <img src={"{" + link + "+"} alt={alt} />
      console.log({link} ); This is Slider
    </div>
  )
}
export default ImageSilder
